import { configureStore } from "@reduxjs/toolkit";
import { contactsReducer } from "./contactsReducer.js";
import devToolsEnhancer from 'remote-redux-devtools';

export const store = configureStore({
    reducer: {
      contactsReducer,
    },
    devTools: true,
    
  });
